import React, { Component } from "react";
import { Provider } from "react-redux";
import { createStore } from "redux";
import { BrowserRouter, Route } from "react-router-dom";

import reducers from "./reducers";
import {
  defaultRoute,
  settingsRoute,
  profiledRoute,
  dashboardRoute
} from "./config/route";
import Dashboard from "./components/dashboard";
import Settings from "./components/settings";
import "./App.css";
import Body from "./components/common/parent";

class App extends Component {
  render() {
    return (
      <Provider store={createStore(reducers)}>
        <BrowserRouter>
          <div className="App">
            <a href={defaultRoute}>Profile</a>
            <a href={settingsRoute}>Setting</a>
            <a href={dashboardRoute}>Dashboard</a>
            <Body>
              <Route
                path={defaultRoute}
                exact={true}
                render={() => <h1>profile</h1>}
              />
              <Route
                path={settingsRoute}
                exact={true}
                render={() => <h1>settings</h1>}
              />
              {/*  <Settings /> */}
              <Route
                path={dashboardRoute}
                exact={true}
                render={() => <h1>dashboard</h1>}
              />
            </Body>
          </div>
        </BrowserRouter>
      </Provider>
    );
  }

  componentDidMount() {
    //  console.log("[store.getState()]",sto)
  }
}

export default App;
